import React from 'react'

console.log(props)
const Song = (props) => {
    return (
        <div className="song-wrapper">

            <img src={props.cover} alt="" className="musicCover"/>
            <h1>{props.name}</h1>
            <h1>{props.artist}</h1>

        </div>
    )
}

export default Song
